import { Component } from "react";
import axios from '../conexion';
var qs = require('qs');

class Registro extends Component{
    constructor (props){
        super(props);
        this.state={
            label: ''
        }
    }
    render(){
        return(
            <div>
                <form>
                    Nombre: <input className="element"></input><br/>
                    Apellido: <input className="element"></input><br/>
                    Email: <input type="email" className="element"></input><br/>
                    Contrase√±a: <input type="password" className="element"></input><br/>
                </form>
                <button className="element">Registrarse</button>
                <label>{this.state.label}</label>
            </div>
        )
    }
}

export default Registro;
